import React from "react";
import PropTypes from "prop-types";

const APP = ({ Compoenet }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>sns_clone</title>
      </Head>
      <Compoenet />
    </>
  );
};

APP.propTypes = {};

export default APP;
